const express = require("express");
const app = express();
const bodyParser = require("body-parser");

//tell express to use body-parser
app.use(bodyParser.urlencoded({extended: true}));

app.use(express.static("public"));
app.set("view engine", "ejs");

let campgrounds = [
  {name: "Crystal Cove State Park", image: "data:image/jpeg;base64," },
  {name: "Big Basin Redwoods St", image: "data:image/jpeg;base64,"},
  {name: "Sequoia National Park", image: "data:image/jpeg;base64,"},
  {name: "San Elijo State Beach", image: "data:image/jpeg;base64,"},
  {name: "Los Padre National Forest", image: "data:image/jpeg;base64,"},
  {name: "Crystal Cove State Park", image: "data:image/jpeg;base64," },
  {name: "Big Basin Redwoods St", image: "data:image/jpeg;base64,"},
  {name: "Sequoia National Park", image: "data:image/jpeg;base64,"},
  {name: "San Elijo State Beach", image: "data:image/jpeg;base64,"},
  {name: "Los Padre National Forest", image: "data:image/jpeg;base64,"},
  {name: "San Elijo State Beach", image: "data:image/jpeg;base64,"},
  {name: "Los Padre National Forest", image: "data:image/jpeg;base64,"},

];

app.get("/", function(req, res) {
  res.render("landing");
});

app.get("/campgrounds", function(req, res) {  
  res.render("campgrounds", {campgrounds: campgrounds});
});

app.post("/campgrounds", function(req, res) {
  let name = req.body.name;
  let image = req.body.image;
  campgrounds.push({name: name, image: image})
  res.redirect("/campgrounds");
});

app.get("/campgrounds/new", function(req, res) {  
  res.render("new");
});

app.get("*", function(req, res) {
  res.render("other")
})

app.listen(3003, function(req, res) {
  console.log("I am listening on port 3003");
});